import "./App.css";
import { Component } from "react";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Linda",
          id:12e3
        },
        {
          name: "Frank",
          id:12e4
        },
        {
          name: "Jacky",
          id:12e5
        },
      ]
    };
  }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map((monsters) => {
            return <div key={monsters.id}>
              <h1>{monsters.name}</h1>
            </div>
          })
        }
      </div>
    );
  }
}

export default App;
